typedef int (*cselect1_t)(const c64* w);
typedef int (*cselect2_t)(const c64* alpha, const c64* beta);

static inline f32 cabs1f(c64 z)
{
    return fabsf(crealf(z)) + fabsf(cimagf(z));
}

static inline f32 cabs2f(c64 z)
{
    return fabsf(crealf(z) / 2.0f) + fabsf(cimagf(z) / 2.0f);
}

